import React from "react";
import "../App.css";
import resume from "./KhyleCVVJan23_23.pdf";
import { Center } from "@chakra-ui/react";


function Resume() {
    const style = {
        border: "1px solid #ddd",
        width: "100%",
        height: "500px",
        padding: "10px"
    }


    return (
        <div id="resume" className="RES">
            <img src={resume} style={style} title="resume" width="70%" height="500px"></img> 
        </div>
    );
}

export default Resume;
